var submodels = msg.payload.InternalElement;
for(var submodel = 0; submodel < submodels.length; submodel++){
    var attributes = submodels[submodel].Attribute;
    for(var attribute in attributes){
        if(attributes[attribute]._Attribs.Name == "Visibility" && attributes[attribute].Value[0].toLowerCase() == "false"){
            //Remove from the list
            submodels.splice(submodel, 1);
            submodel--;
            break;
        } else if(attributes[attribute]._Attribs.Name == "Visibility" && attributes[attribute].Value[0].toLowerCase() == "true"){
            //Check only DataManifests
            var dsms = submodels[submodel].InternalElement;
            if(typeof dsms !== "undefined"){
                for(var dsm = 0; dsm < dsms.length; dsm++){
                    var dsm_attributes = dsms[dsm].Attribute;
                    for(var dsm_attribute in dsm_attributes){
                        if(dsm_attributes[dsm_attribute]._Attribs.Name == "Visibility" && dsm_attributes[dsm_attribute].Value[0] == "false"){
                            //Remove from the list
                            dsms.splice(dsm, 1);
                            dsm--;
                            break;
                        }
                    }
                }
            }
        }
    }
}
return msg;

